    false,nt"url": null,nt"notes": "This report provides detailed (1:63,360-scale)
    mapping of the Tanana A-1 and A-2 quadrangles (500 square miles; equivalent to eight
    7.5-minute quadrangles). The area is part of the Manley Hot Springs-Tofty mining
    districts and adjacent to the Rampart mining district to the south of the Tanana
    B-1 Quadrangle. This report includes detailed geologic construction materials and
    geologic hazards data. The Tanana A-1 and A-2 Quadrangles and surrounding area comprise
    several isolated mountainous ridges in the western Yukon-Tanana Upland of interior
    Alaska.",nt"license_title": null,nt"extras": [{ntt"key": "temporal-extent-begin",ntt"value":
